    auth_set = set(authorizedUses)
    res = set()
    i = 1
    while i < len(data):
        if i < len(data) - 2 and data[i][0] == data[i + 2][0]:
            j = i + 2
            while j < len(data) and data[j][0] == data[i][0]:
                if int(data[j][1][:2]) * 60 + int(data[j][1][3:]) - int(data[i][1][:2]) * 60 - int(data[i][1][3:]) <= 60 and (data[i][1] not in auth_set and data[j][1] not in auth_set):
                    res.add(data[i][0])
                    break
                j += 1
        i += 1
    return sorted(list(res))

